contracts/NftAuction.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;


contract NftAuction {
    struct Auction {
        // 卖家
        address seller;
        // 拍卖持续时间
        uint256 duration;
        // 起始价格
        uint256 startPrice;
        // 开始时间
        uint256 startTime;
        // 是否结束
        bool ended;
        // 最高出价者
        address highestBidder;
        // 最高出价 
        uint256 highestBid;
    }

    // 状态变量
    mapping(uint256 => Auction) public auctions;
    // 下一个拍卖ID
    uint256 public nextAuctionId;
    // 管理员地址
    address public admin;

    constructor()payable {
        admin = msg.sender; // 部署合约的地址为管理员
    }

    // 创建拍卖
    function createAuction(uint256 _duration, uint256 _startPrice) public {
        // 只有管理员可以创建拍卖
        require(msg.sender == admin, "Only admin can create auctions");
        // 验证输入参数
        require(_duration > 0, "Duration must be greater than 0");
        require(_startPrice > 0, "Start price must be greater than 0");
        auctions[nextAuctionId] = Auction({
            seller: msg.sender,
            duration: _duration,
            startPrice: _startPrice,
            startTime: block.timestamp,
            ended: false,
            highestBidder: address(0),
            highestBid: 0
        });

        nextAuctionId++;
    }

    // 买家参与买单
    function placeBid(uint256 _auctionId) public payable {
        Auction storage auction = auctions[_auctionId];
        // 验证拍卖是否存在
        require(_auctionId < nextAuctionId, "Auction does not exist");
        // 验证拍卖是否结束
        require(!auction.ended && block.timestamp > auction.startTime + auction.duration, "Auction has ended");
        // 验证出价是否高于当前最高出价
        require(msg.value > auction.highestBid && msg.value >= auction.startPrice, "Bid must be higher than current highest bid and start price");

        // 如果有出价者，退还之前的最高出价
        if (auction.highestBidder != address(0)) {
            payable(auction.highestBidder).transfer(auction.highestBid);
        }

        // 更新拍卖信息
        auction.highestBidder = msg.sender;
        auction.highestBid = msg.value;
    }
}

